`MkContents#create()` should be implemented first, I think. However, the issue for its corresponding puzzle has not yet been created.

@dmarkov , by any chance does this issue refer to `MkContentsTest.java:79-82`? The puzzle for `MkContentsTest.java:64-67` is the following:

> MkContents should support the creation of mock contents. This method should create a new instance of MkContent. Do not forget to implement a unit test for it here and remove the Ignore annotation.
